import "./App.css";
import Navbar from "./components/navbar/Navbar";
import Button from "./components/button/Button";

import Card from "./components/card/Card";
import compu from "./assets/img/compu.png";

function App() {
  return (
    <div className="App">
      <header>
        <Navbar />
      </header>
      <main>
        <div
          id="home"
          className="d-flex justify-content-space-between align-items-center"
        >
          <div className="main-title">
            <h1>
              El impulso
              <br />
              que hace crecer
              <br />
              tu marca
            </h1>

            <Button texto="Hablemos!" variant="primario" />
          </div>
          <div>
            <img
              src={compu}
              alt="Una mano sosteniendo un megáfono sale desde la pantalla de una computadora portátil, con un fondo de líneas onduladas en tonos azul y turquesa"
            />
          </div>
        </div>
        <div>

        </div>
      </main>
    </div>
  );
}

export default App;
